import React from 'react';

const SuperHeader = React.memo(function(props){

    const columns = props.columns;
    console.log(columns.length);

    return <thead>{/*div header*/}
        <tr>{/*real header*/}
            {(columns.length > 0 && columns.map((label, index) => <th key={index} onClick={props.headerSort}>{label}</th>)) || <th>header</th>}{/*каждая колонка*/}
        </tr>
    </thead>
});

export default SuperHeader;
